/*
 Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.
 
 Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.
 
 The order of output does not matter.
 */



class Solution {
    func findAnagrams(_ s: String, _ p: String) -> [Int] {
        guard s.count > 0, s.count >= p.count else {
            return []
        }
        let sarr:[Character] = Array(s)
        let parr:[Character] = Array(p)
        var count = parr.count
        var result = Array<Int>()
        var map = Dictionary<Character, Int>()
        
        for p in parr {
            if map[p] == nil {
                map[p] = 0
            }
            map[p]! += 1
        }
        
        var left = 0
        var right = 0
        
        while right < sarr.count {
            if map[sarr[right]] == nil {
                map[sarr[right]] = 0
            }
            
            if map[sarr[right]]! > 0 {
                count -= 1
            }
            map[sarr[right]]! -= 1
            right += 1
            
            if count == 0 {
                result.append(left)
            }
            
            if right - left == parr.count {
                if map[sarr[left]] == nil {
                    map[sarr[left]] = 0
                }
                if map[sarr[left]]! >= 0 {
                    count += 1
                }
                map[sarr[left]]! += 1
                left += 1
            }
            
        }
        
        return result
    }
    
}

var temp = Solution()
temp.findAnagrams("", "")
